        attachCallback = function(settings) {
            settings.target.querySelectorAll('li a').forEach(function(element) {
                element.addEventListener('click', function(e) {
                    e.stopPropagation();
                    e.preventDefault();
                    settings.callback(e);
                });
            });

            //$('li a', $(settings.target)).on('click.autocomplete', function(e) {
            //    e.stopPropagation();
            //    e.preventDefault();
            //    settings.callback(e);
            //});
        },
