/**
 * Opciones de clustering de puntos de una capa, define si los puntos se tienen que agrupar cuando estn ms cerca entre s que un valor umbral.
 *
 * Hay que tener en cuenta que el archivo `config.json` de una maquetacin puede sobreescribir los valores por defecto de esta propiedad 
 * (para ver instrucciones de uso de maquetaciones, consultar {@tutorial layout_cfg}).
 * @typedef ClusterOptions
 * @property {number} distance - Distancia en pxels que tienen que tener como mximo los puntos entre s para que se agrupen en un cluster.
 * @property {boolean} [animate] - Si se establece a `true`, los puntos se agrupan y desagrupan con una transicin animada.
 * @property {ClusterStyleOptions} [styles] - Opciones de estilo de los clusters.
 * @example <caption>[Ver en vivo](../examples/cfg.LayerOptions.cluster.html)</caption> {@lang html}
 * <div id="mapa"></div>
 * <script>
 *     // Creamos un mapa con una capa de puntos de un KML,
 *     // clustering activado a 50 pixels y transiciones animadas.
 *     var map = new SITNA.Map("mapa", {
 *         workLayers: [
 *             {
 *                 id: "cluster",
 *                 type: SITNA.Consts.layerType.KML,
 *                 url: "data/PromocionesViviendas.kml",
 *                 title: "Clusters",
 *                 cluster: {
 *                     distance: 50,
 *                     animate: true
 *                 }
 *             }
 *         ]
 *     });
 * </script>
 */

/**
 * Opciones de capa. Este objeto se utiliza en al [configurar un mapa]{@linkplain MapOptions}, el [control del catlogo de capas]{@linkplain LayerCatalogOptions} 
 * o como parmetro al [aadir una capa]{@linkplain SITNA.Map#addLayer}.
 * @typedef LayerOptions
 * @see MapOptions
 * @see LayerCatalogOptions
 * @see SITNA.Map#addLayer
 * @see SITNA.Map#setBaseLayer
 * @property {string} id - Identificador nico de capa. No puede haber en un mapa dos capas con el mismo valor de `id`.
 * @property {ClusterOptions} [cluster] - La capa agrupa sus entidades puntuales cercanas entre s en grupos (clusters). 
 * Aplicable a capas de tipo {@link SITNA.Consts.layerType.VECTOR}, {@link SITNA.Consts.layerType.WFS} y {@link SITNA.Consts.layerType.KML}.
 * @property {string} [format] - En las capas de tipo {@link SITNA.Consts.layerType.WMS} y {@link SITNA.Consts.layerType.WMTS},
 * es el tipo MIME del formato de archivo de imagen a obtener del servicio. En las capas de tipo {@link SITNA.Consts.layerType.VECTOR}, es el tipo MIME
 * del formato de archivo de datos geogrficos que queremos cargar (GeoJSON, KML, etc.).
 * 
 * Si esta propiedad no est definida, si la capa es un mapa de fondo (consultar propiedad `isBase`), se asume que el formato es `image/jpeg`, en caso contrario se asume que el formato es `image/png`.
 *
 * Para asignar valor a esta propiedad se puede usar las constantes de definidas en {@link SITNA.Consts.mimeType}.
 * @property {boolean} [hideTree] - Aplicable a capas de tipo {@link SITNA.Consts.layerType.WMS} y {@link SITNA.Consts.layerType.KML}.
 * Si se establece a `true`, la capa no muestra la jerarqua de grupos de capas en la tabla de contenidos ni en la leyenda.
 * @property {boolean} [isBase] - Si se establece a `true`, la capa es un mapa de fondo.
 * @property {boolean} [isDefault] - *__Obsoleta__: En lugar de esta propiedad es recomendable usar la propiedad `defaultBaseLayer`de {@link MapOptions}.*
 * 
 * Si se establece a true, la capa se muestra por defecto si forma parte de los mapas de fondo.
 * @property {string} [layerNames] - Lista separada por comas de los nombres de capa del servicio OGC. Aplicable a capas de tipo {@link SITNA.Consts.layerType.WMS} y {@link SITNA.Consts.layerType.WMTS}.
 * @property {string} [matrixSet] - Nombre de grupo de matrices del servicio WMTS. Propiedad obligatoria para capas de tipo {@link SITNA.Consts.layerType.WMTS}.
 * @property {boolean} [stealth] - Si se establece a `true`, la capa no aparece en la tabla de contenidos ni en la leyenda. 
 * De este modo se puede aadir una superposicin de capas de trabajo que el usuario la perciba como parte del mapa de fondo.
 * @property {string} [thumbnail] - URL de una imagen en miniatura a mostrar en el selector de mapas de fondo.
 * @property {string} [title] - Ttulo de capa. Este valor se mostrar en la tabla de contenidos y la leyenda.
 * @property {string} [type] - Tipo de capa. Si no se especifica se considera que la capa es WMS. La lista de valores posibles est definida en {@link SITNA.Consts.layerType}.
 * @property {string} [url] - URL del servicio OGC o del archivo de datos geogrficos que define la capa. Propiedad obligatoria en capas de tipo {@link SITNA.Consts.layerType.WMS},
 * {@link SITNA.Consts.layerType.WMTS}, {@link SITNA.Consts.layerType.WFS} y {@link SITNA.Consts.layerType.KML}.
 * 
 * En las capas de tipo {@link SITNA.Consts.layerType.VECTOR} los archivos de datos geogrficos soportados son KML, GeoJSON, GPX, GML, WKT y TopoJSON.
 * El formato se deduce de la extensin del nombre de archivo, pero tambin se puede especificar utilizando la propiedad `format`.
 * @example <caption>Ejemplo de uso de la propiedad `url` - [Ver en vivo](../examples/cfg.LayerOptions.url.html)</caption> {@lang html}
 * <div id="mapa"></div>
 * <script>
 *     // Establecemos un layout simplificado apto para hacer demostraciones de controles.
 *     SITNA.Cfg.layout = "layout/ctl-container";
 *     // Aadimos el control de tabla de contenidos en la primera posicin.
 *     SITNA.Cfg.controls.TOC = {
 *         div: "slot1"
 *     };
 *     // Aadimos una capa raster desde un servicio WMS y cuatro capas vectoriales
 *     // a partir de archivos geogrficos: GeoJSON, GPX, KML y GML.
 *     SITNA.Cfg.workLayers = [
 *         {
 *             id: "wms",
 *             title: "Camino de Santiago",
 *             type: SITNA.Consts.layerType.WMS,
 *             url: "//idena.navarra.es/ogc/wms",
 *             layerNames: "IDENA:PATRIM_Lin_CaminoSantR",
 *             format: SITNA.Consts.mimeType.PNG
 *         },
 *         {
 *             id: "geojson",
 *             type: SITNA.Consts.layerType.VECTOR,
 *             url: "data/PARQUESNATURALES.json",
 *             format: SITNA.Consts.mimeType.GEOJSON
 *         },
 *         {
 *             id: "gpx",
 *             type: SITNA.Consts.layerType.VECTOR,
 *             url: "data/CAMINOFRANCES.gpx"
 *         },
 *         {
 *             id: "kml",
 *             type: SITNA.Consts.layerType.VECTOR,
 *             url: "data/MUSEOSNAVARRA.kml"
 *         },
 *         {
 *             id: "gml",
 *             type: SITNA.Consts.layerType.VECTOR,
 *             url: "data/ESTACIONESTREN.gml"
 *         },
 *     ];
 *     var map = new SITNA.Map("mapa");
 * </script>
 */

