/**
 * Opciones de control de bsquedas. La configuracin por defecto tiene como origen de datos el WFS de IDENA. 
 * Es posible establecer un origen de datos distinto en el que consultar, para ello en lugar de asignar un booleano a la propiedad, que activa o desactiva la bsqueda, 
 * se asignar un objeto con las propiedades a sobrescribir. Las propiedades a sobrescribir no siempre sern las mismas, variarn en funcin de la configuracin que tenga la bsqueda que se quiera modificar.
 * @typedef SearchOptions
 * @extends ControlOptions
 * @see MapControlOptions
 * @property {HTMLElement|string} [div] - Elemento del DOM en el que crear el control o valor de atributo id de dicho elemento.
 * @property {boolean|CadastralSearchOptions} [cadastralParcel=true] - Esta propiedad activa/desactiva la bsqueda de parcelas catastrales en el buscador del mapa. Formato: municipio, polgono, parcela.
 *
 * Para configurar un origen de datos distinto a IDENA, establecer como valor una instancia de {@link CadastralSearchOptions}.
 *
 * @property {boolean} [coordinates=true] - Esta propiedad activa/desactiva la localizacin de coordenadas en Sistema de Referencia ETRS89, bien UTM Huso 30 Norte (EPSG:25830) o latitud-longitud (EPSG:4258, EPSG:4326 o CRS:84) en el buscador del mapa.
 * @property {string} [instructions="Buscar municipio, casco urbano, calle, direccin, referencia catastral, coordenadas UTM o latitud-longitud"] - Esta propiedad establece el atributo `title` del cajetn y del botn del buscador del mapa.
 * @property {boolean|MunicipalitySearchOptions} [municipality=true] - Esta propiedad activa/desactiva la bsqueda de municipios en el buscador del mapa.
 *
 * Para configurar un origen de datos distinto a IDENA, establecer como valor una instancia de {@link MunicipalitySearchOptions}.
 * @property {boolean|PostalAddressSearchOptions} [postalAddress=true] - Esta propiedad activa/desactiva la bsqueda de direcciones postales en el buscador del mapa. Formato: entidad de poblacin, va, portal.
 * @property {boolean|StreetSearchOptions} [street=true] - Esta propiedad activa/desactiva la bsqueda de vas en el buscador del mapa. Formato: entidad de poblacin, va.
 * @property {boolean|TownSearchOptions} [town=true] - Esta propiedad activa/desactiva de cascos urbanos en el buscador del mapa.
 *
 * Para configurar un origen de datos distinto a IDENA, establecer como valor una instancia de {@link TownSearchOptions}.
 * @example <caption>[Ver en vivo](../examples/cfg.SearchOptions.html)</caption> {@lang html}
 * <div id="mapa"></div>    
 * <script>
 *     // Creamos un mapa con el control de bsquedas. 
 *     // Configuramos el buscador desactivando la bsqueda de parcelas y la localizacin de coordenadas.
 *     // Indicamos un placeHolder y tooltip (propiedad "instructions") acorde con las bsquedas configuradas.
 *     var map = new SITNA.Map("mapa", {
 *         controls: {
 *             search: {
 *                 coordinates: false,
 *                 cadastralParcel: false,
 *                 municipality: true,
 *                 town: true,
 *                 street: true,
 *                 postalAddress: true,
 *                 placeHolder: "Municipio, casco urbano, calle o portal",
 *                 instructions: "Buscar municipio, casco urbano, calle o portal"
 *             }
 *         }
 *     });
 * </script>
 */
  
