    // GLS: Segn MDN: https://developer.mozilla.org/es/docs/Web/API/WebGL_API/Tutorial/Wtilizando_texturas_en_WebGL
    //    Note: Es importante sealar que la carga de texturas en WebGL sigue reglas de dominio-cruzado; 
